import React from "react";
import './Card.scss';

const BeigeCard: React.FC<{img: string, title: string, detail: string }>= (props) => {
    return (
            <div className="beige-card"><img src={props.img} alt="img" className="app-icon"></img> <h3 className="card-title">{props.title}</h3><p className="card-detail">{props.detail}</p></div>
    );
}
export default BeigeCard;
